import React, { useEffect, useState } from 'react';
import { useDispatch, useSelector } from "react-redux";
import { Navigate, useNavigate } from 'react-router-dom';
import { fetchList } from '../actions/cloud';
import CustomCard from '../components/ui/CustomCard';

function VmManagement() {

  const [machineList, setMachineList] = useState([]);

  const { user: currentUser } = useSelector((state) => state.auth);
  const { vmList } = useSelector((state) => state.cloud);
  const dispatch = useDispatch();

  useEffect(() => {
    (async function () {
      await dispatch(fetchList());
    })();
  }, []);

  useEffect(() => {
    (async function () {
      console.log("firing this");
      console.log(vmList);
      setMachineList(vmList);
    })();
  }, [vmList]);


  if (!currentUser) {
    return <Navigate to="/login" />;
  }

  return (
    <div className="col-md-12">
      {(vmList && vmList.length > 0) ? vmList.Map((item) => { return <CustomCard data={item} />; }) : null}
    </div>
  )
}

export default VmManagement;
